import { Chart } from "react-google-charts";
export const data = [
  
   
  ["Work", 90],
  
];
export const options = {
  title: "My Daily Activities",
};

const charts = () => {
  return (
    <Chart
      chartType="PieChart"
      data={data}
     
      width={"400px"}
      height={"400px"}
    />
  )
}
export default charts
